    YOW += y[8]*imw[8]; /*H2O2 */
    YOW += y[9]*imw[9]; /*CH */
    YOW += y[10]*imw[10]; /*HCO */
    YOW += y[11]*imw[11]; /*CH2 */
    YOW += y[12]*imw[12]; /*CO2 */
    YOW += y[13]*imw[13]; /*CO */
    YOW += y[14]*imw[14]; /*CH2O */
    YOW += y[15]*imw[15]; /*CH2GSG */
    YOW += y[16]*imw[16]; /*CH3 */
    YOW += y[17]*imw[17]; /*CH3O */
